import React from "react";

function Task() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-6">
          <button style={{ width: "100%" }} className="btn btn-outline-primary">
            Task
          </button>
        </div>
      </div>
    </div>
  );
}

export default Task;
